import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  SafeAreaView,
} from "react-native";
import { DatePicker, TimePicker } from "react-native-ultimate-modal-picker";

const DateSetting = (date) => {
  const setDate = (date) => {
    console.log(date);
  };
  const setTime = (time) => {
    console.log(time);
  };
  return (
    <TouchableOpacity>
      <SafeAreaView>
        <View style={styles.settingsItem}></View>
        <DatePicker
          title="Date"
          onChange={(date) => setDate(date)}
          mode="spinner"
        />
        <TimePicker
          title="Time"
          onChange={(time) => setTime(time)}
          mode="default"
        />
      </SafeAreaView>
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  settingsItem: {
    height: 50,
    justifyContent: "center",
  },
  itemText: {
    marginLeft: 10,
    fontSize: 20,
  },
});

export default DateSetting;
